import React ,{useState}from "react";
import "./Signup.css";
import { Link } from "react-router-dom";

const Signup = () => {

  const [state, setstate] = useState({
     name:"",email:"",phone:"",work:"",password:"",cpassword:""
  })
  return (
    <div>
      <div class="af_form">
        <form>
          <div class="af_body">
            <div class="af_header">
              <h2 id="af_two">Signup</h2>
            </div>
            <div class="af_block">
              <label id="af_name" for="name">
              Name
              </label>
              <input autoComplete="off" id="af_name" type="text" for="name" />
            </div>

            <div class="af_block">
              <label id="af_Mail" for="mail">
                Email
              </label>
              <input autoComplete="off" for="mail" typr="text" id="af_mail" />
            </div>

            <div class="af_block">
              <label id="af_Num" for="num">
                Number
              </label>
              <input autoComplete="off" for="num" type="number" id="af_num" />
            </div>

            <div class="af_block">
              <label id="af_Age" for="age">
                Work
              </label>
              <input autoComplete="off" id="af_age" type="number" for="age" />
            </div>

            <div class="af_block">
              <label id="af_Gen" for="gen">
                Password
              </label>
              <input  autoComplete="off" for="gen" type="text" id="af_gen" />
            </div>

            <div class="af_block">
              <label id="af_Gen" for="gen">
                Cpassword
              </label>
              <input autoComplete="off" for="gen" type="text" id="af_gen" />
            </div>
          </div>
          <input id="af_submit" type="submit" value="Register" />
          <p>
          <Link to="/login">Login</Link>
      </p> 
        </form>
       
      </div>
    </div>
  );
};

export default Signup;

